goog.require("axs.AuditRules");goog.require("axs.browserUtils");goog.require("axs.constants");goog.require("axs.utils");axs.AuditRules.addRule({name:"badAriaRole",heading:"Elements with ARIA roles must use a valid, non-abstract ARIA role",url:"https://github.com/GoogleChrome/accessibility-developer-tools/wiki/Audit-Rules#ax_aria_01",severity:axs.constants.Severity.SEVERE,relevantElementMatcher:function(element){return axs.browserUtils.matchSelector(element,"[role]")},test:function(element){var roles=axs.utils.getRoles(element);return!roles.valid},code:"AX_ARIA_01"});